import './App.css';
import logo from './Pictures/plogo.png';
import homeScreen from './Pictures/homeScreen.jpg'
import axios from "axios";
import React from "react";
import { useState, useEffect } from "react";
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Container, Row, Col, Dropdown } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import specialEventParkingImage from "./specialEventParkingImage.jpg"
import golfCartServicesImage from "./specialEventParkingImage.jpg"
import logo1 from "./Pictures/logo1.png"
import logo2 from "./Pictures/logo2.png"
import logo3 from "./Pictures/logo3.png"
import logo4 from "./Pictures/logo4.png"
import logo5 from "./Pictures/logo5.png"
import logo6 from "./Pictures/logo6.png"
import logo7 from "./Pictures/logo7.jpg"
import logo8 from "./Pictures/logo8.png"
import logo9 from "./Pictures/logo9.png"
import logo10 from "./Pictures/logo10.png"
import logo11 from "./Pictures/logo11.png"




export function HomePage() {

    const ServicesSection = () => {
        return (

            <div >
              <div className="service special-event-parking">

                <img src={specialEventParkingImage} style={{marginLeft:'3%', width: '20%'}} alt="Special Event Parking" />
                <div className="service-info">
                  <h2 >Special Event Parking</h2>
                  <p style={{marginRight:'3%'}}>Parking teams are dispatched to event locations to coordinate all aspects of parking and transportation. The San Francisco-based production team will analyze the event location and propose a parking and transportation solution.</p>
                  <button>Learn more</button>
                </div>
              </div>
              <div className="service golf-cart-services">
                <div className="service-info">
                  <h2 style={{marginLeft:'4%'}} >Golf Cart Services</h2>
                  <p style={{marginLeft:'4%'}}>Courteous and professional drivers provide golf cart service for event guests and patrons with limited mobility. Golf cart service is particularly useful in challenging parking scenarios.</p>
                  <button style={{marginLeft:'4%'}}>Learn more</button>

                </div>
                <img src={golfCartServicesImage} style={{marginRight:'3%', width: '20%'}}  alt="Golf Cart Services" />
              </div>

            </div>

        );
      }
      const WelcomeSection = () => {
        return (
            <div>
              <div className="header-content">
                <h1>WELCOME TO PENINSULA PARKING</h1>
                <div className="header-separator"></div>
                <p style={{color: 'black'}}>We are an industry leader and trusted partner providing parking solutions of all kinds in the Bay Area. We provide valet service, traffic flow and lot management, shuttle service, and other concierge services for private and public events at homes and venues. Our team has been serving the Bay Area for nearly 20 years, providing top-quality customer service and earning a “Diamond Certified” rating.</p>
              </div>

            </div>
          );
      }
const LogoBar = () => {
    const logos = [logo1, logo2, logo3, logo4, logo5, logo6, logo7, logo8, logo9, logo10, logo11];
    return (
      <div className="logo-bar-container">
        <div className="logo-bar">
          {logos.map((logo, index) => (
            <img key={index} src={logo} alt="Company Logo" />
          ))}
          {/* Repeat the logos for a smoother transition */}
          {logos.map((logo, index) => (
            <img key={'copy-' + index} src={logo} alt="Company Logo" />
          ))}
        </div>
      </div>
    );
  }



  const Image = () => {
